import React from 'react';

interface GooglePreviewProps {
    title: string;
    description: string;
    url: string;
    image: string;
}

const GooglePreview: React.FC<GooglePreviewProps> = ({ title, description, url, image }) => {
    return (
        <div style={{ border: '1px solid #ccc', padding: '10px', width: '400px', fontFamily: 'Arial, sans-serif' }}>
            <div style={{ marginBottom: '5px', color: '#1a0dab', fontSize: '18px', fontWeight: 'bold' }}>
                <a href={url} target="_blank" rel="noopener noreferrer">{title}</a>
            </div>
            <div style={{ marginBottom: '5px', color: '#006621' }}>{url}</div>
            <div style={{ marginBottom: '5px', color: '#545454' }}>{description}</div>
            {image && <img src={image} alt="Preview" style={{ maxWidth: '100%', height: 'auto' }} />}
        </div>
    );
};

export default GooglePreview;
